import logo from './logo.svg';
import './App.css';
import Shop from './components/Shop';

function App() {
  const resp = fetch('http://localhost:5001/api/products/all').then(res=>res.json()).then(res=>resp=res)

  return (
    <div className="App">
      <header className="App-header">
        {
          resp.map((item, i)=>{
            return (
              <div>
                <Shop shop = {item} key = {item.id}/>
              </div>
            )
          }
          )
        }
      </header>
    </div>
  );
}

export default App;
